export default function TaskInfo(props) {
	return (
		<div className="TaskInfo">
			<h1>Title</h1>
			<h3>Due Date:{props.title}</h3>
			<h3>Task Type: </h3>
			<button className="TaskInfoDeleteBtn">Delete</button>
			<button className="TaskInfoCloseBtn">Close</button>
		</div>
	);
}
